PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?seat ?seatLabel WHERE {
  wd:Q7159 wdt:P159 ?seat .
  OPTIONAL {
    ?seat rdfs:label ?seatLabel FILTER ( LANG( ?seatLabel ) = "en" )
  }
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT DISTINCT ?country ?countryLabel WHERE {
  wd:Q3542 ?riverProp ?country .
  VALUES ?riverProp {
    wdt:P17 wdt:P205
  }
  wd:Q66065 wdt:P17 ?country .
  OPTIONAL {
    ?country rdfs:label ?countryLabel .
    FILTER ( LANG( ?countryLabel ) = "en" )
  }
}
ORDER BY ?countryLabel

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT DISTINCT ?work ?workLabel ?workTypeLabel WHERE {
  VALUES ?actor {
    wd:Q207598
  }
  VALUES ?allowedType {
    wd:Q11424 wd:Q202866 wd:Q506240 wd:Q5398426 wd:Q13226383 wd:Q288851 wd:Q2668558
  }
  {
    ?work wdt:P161 ?actor .
  } UNION {
    ?work wdt:P725 ?actor .
  } UNION {
    ?work wdt:P175 ?actor .
  }
  ?work wdt:P31 ?type .
  FILTER ( ?type IN ( ?allowedType ) ) OPTIONAL {
    ?work rdfs:label ?workLabel FILTER ( LANG( ?workLabel ) = "en" )
  }
  OPTIONAL {
    ?type rdfs:label ?workTypeLabel FILTER ( LANG( ?workTypeLabel ) = "en" )
  }
}
ORDER BY ?workLabel
LIMIT 500

