PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?placeOfBirth ?placeOfBirthLabel ?ancestor ?ancestorLabel ?country ?countryLabel ?citizenCountry ?citizenCountryLabel WHERE {
