PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX p: <http://www.wikidata.org/prop/>
SELECT ?relationType ?partner ?partnerLabel ?start ?end WHERE {
  {
    wd:Q575689 p:P451 ?psnode .
    ?psnode ps:P451 ?partner .
    OPTIONAL {
      ?psnode pq:P580 ?start .
    }
    OPTIONAL {
      ?psnode pq:P582 ?end .
    }
    BIND( "unmarried partner" AS ?relationType )
  } UNION {
    wd:Q575689 p:P26 ?psnode .
    ?psnode ps:P26 ?partner .
    OPTIONAL {
      ?psnode pq:P580 ?start .
    }
    OPTIONAL {
      ?psnode pq:P582 ?end .
    }
    BIND( "spouse" AS ?relationType )
  }
  OPTIONAL {
    ?partner rdfs:label ?partnerLabel FILTER ( LANG( ?partnerLabel ) = "en" )
  }
}
ORDER BY ?relationType ?start

