  }
  OPTIONAL {
    ?tzItem wdt:P2907 ?offset
  }
  {
    ?tzItem wdt:P6687 ?ianaID .
    BIND( ?tzItem AS ?ianaItem ) .
    OPTIONAL {
      ?ianaItem rdfs:label ?ianaLabel FILTER ( LANG( ?ianaLabel ) = "en" )
    }
  } UNION {
    ?parent wdt:P460 ?tzItem .
    ?parent wdt:P527 ?ianaItem .
    ?ianaItem wdt:P6687 ?ianaID .
    OPTIONAL {
      ?ianaItem rdfs:label ?ianaLabel FILTER ( LANG( ?ianaLabel ) = "en" )
    }
  } UNION {
    ?ianaItem wdt:P361 ?parent2 .
    ?parent2 wdt:P460 ?tzItem .
    ?ianaItem wdt:P6687 ?ianaID .
    OPTIONAL {
      ?ianaItem rdfs:label ?ianaLabel FILTER ( LANG( ?ianaLabel ) = "en" )
    }
