PREFIX p: <http://www.wikidata.org/prop/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
SELECT DISTINCT ?person ?personLabel ?seat ?seatLabel ?start ?end WHERE {
  VALUES ?seat {
    wd:Q101498883 wd:Q101498993
  }
  ?person p:P39 ?stmt .
  ?stmt ps:P39 wd:Q4416090 .
  ?stmt pq:P768 ?seat .
  OPTIONAL {
    ?stmt pq:P580 ?start
  }
  OPTIONAL {
    ?stmt pq:P582 ?end
  }
  FILTER ( ( ! bound( ?end ) || ?end >= "2013-01-01T00:00:00Z" ^^ xsd:dateTime ) && ( ! bound( ?start ) || ?start <= "2013-12-31T23:59:59Z" ^^ xsd:dateTime ) ) OPTIONAL {
    ?person rdfs:label ?personLabel .
    FILTER ( LANG( ?personLabel ) = "en" )
  }
  OPTIONAL {
    ?seat rdfs:label ?seatLabel .
    FILTER ( LANG( ?seatLabel ) = "en" )
  }
}
ORDER BY ?personLabel

